import React, { useEffect, useState } from 'react';
import axios from 'axios';

const SuperAdminDashboard = () => {
  const [requestStats, setRequestStats] = useState({});
  const [delayedRequests, setDelayedRequests] = useState([]);
  const [residentCount, setResidentCount] = useState(0);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const [statsRes, delayedRes, residentsRes] = await Promise.all([
        axios.get('/api/superadmin/request-statistics'),
        axios.get('/api/superadmin/delayed-requests'),
        axios.get('/api/superadmin/resident-count')
      ]);

      setRequestStats(statsRes.data);
      setDelayedRequests(delayedRes.data);
      setResidentCount(residentsRes.data);
    } catch (error) {
      console.error('Error loading dashboard data:', error);
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Super Admin Dashboard</h2>

      <div className="mb-6">
        <h3 className="text-xl font-semibold">Request Statistics</h3>
        <ul className="list-disc pl-5">
          <li>Total Requests: {requestStats.total}</li>
          <li>Pending: {requestStats.pending}</li>
          <li>Completed: {requestStats.completed}</li>
        </ul>
      </div>

      <div className="mb-6">
        <h3 className="text-xl font-semibold">Delayed Requests</h3>
        {delayedRequests.length === 0 ? (
          <p>No delayed requests</p>
        ) : (
          <ul className="list-disc pl-5">
            {delayedRequests.map((req) => (
              <li key={req.id}>{req.serviceType} - Raised on {req.raisedDate}</li>
            ))}
          </ul>
        )}
      </div>

      <div>
        <h3 className="text-xl font-semibold">Number of Residents</h3>
        <p>{residentCount}</p>
      </div>
    </div>
  );
};

export default SuperAdminDashboard;
